import logo from './applogo.png';
import './App.css';
import Form from './components/Form';

function App() {
  return (
    <div className="App"><Form/>
      <header className="App-header"></header>
        <img src={logo} className="App-logo" alt="logo" />
    </div>
    )
    };


export default App;
